      const re = real[k];
      const im = imag[k];
      
      // Magnitude
      this.anaMagn[k] = 2.0 * Math.sqrt(re * re + im * im);
      
      // Phase
      const phase = this.fastAtan2(im, re);
      
      // Phase difference
